import './expenseItem.css'

function ExpenseItem (){
    return (
        <div className="expense-container">
            <div>March 28 2022</div>
            <div>
                <h2>Car Insurance</h2>
                
            </div>
            <div className="price">$294.67</div>
        </div>
    )
}

export default ExpenseItem;
